INSERT INTO `trivia` VALUES ('7', 'Name the city where this happened in 1989.', '[\"Beijing\",\"Bayjing\",\"Beijjing\"]', '70000', '30000', '30000', '', '10', '', '0', '1', null, null), ('11', 'Who starred in Parks and Recreation?', '[\"Amy Poehler\",\"Amy Poler\"]', '70000', '30000', '30000', 'The show lasted 2 seasons and ended in 2009.', '10', '', '0', '1', null, null), ('22', 'How many takes did Clare Torry require to record her part in Pink Floyd\'s \"The Great Gig In The Sky\"?', '[\"One\"]', '70000', '30000', '30000', 'She was paid the standard flat fee of £30 for Sunday studio work.', '10', '', '0', '1', null, null), ('19', 'How many sides does a tetrahedron have?', '[\"Four\"]', '70000', '30000', '30000', 'The tetrahedron shape is seen in nature in covalent bonds of molecules.  For this reason, one of the leading journals in organic chemistry is called Tetrahedron. ', '10', '', '0', '1', null, null), ('24', 'Name this band.', '[\"Cake\"]', '70000', '30000', '30000', 'Their sixth full-length album, <i>Showroom of Compassion</i>, is scheduled to be released on January 11, 2011.', '10', '', '0', '1', null, null), ('23', 'Who wrote this song?', '[\"JJ Cale\",\"J J Cale\",\"JJ Kale\", \"J.J. Cale\"]', '70000', '30000', '30000', 'JJ Cale declined an invitation to American Bandstand after learning he would be required to lip-sync.', '10', '', '0', '1', null, null), ('25', 'Name this device. It is used to treat asthma and respiratory diseases by delivering a medicated mist into the lungs.', '[\"nebulizer\",\"nebuliser\",\"nebulizor\", \"nebulisor\"]', '70000', '30000', '30000', '', '10', '', '0', '1', null, null), ('51', 'Barack Obama is the first black United States President. He is also the first black president of this journal of legal scholarship at Harvard.', '[\"Harvard Law Review\"]', '70000', '30000', '30000', 'In 1990, Obama\'s selection as president of the <i>Harvard Law Review</i> received national media attention.', '10', '', '0', '1', '3', null), ('59', 'Which movie was not nominated in the 1982 Oscar race in Visual Effects presumably because computer graphics were considered to be cheating?', '', '70000', '30000', '30000', 'Roger Ebert was so convinced that this film had not been given its due credit by both critics and audiences that he decided to close his first annual Overlooked Film Festival with a showing of <i>Tron</i>.', '10', '[{\"answer\":\"Tron\",\"correct\":true},{\"answer\":\"Star Wars: The Empire Strikes Back\",\"correct\":false},{\"answer\":\"War Games\",\"correct\":false},{\"answer\":\"Raiders of the Lost Ark\",\"correct\":false}]', '1', '1', null, null), ('88', 'Name the fictional United States icon who Norman Rockwell painted and who was featured on the cover of Saturday Morning Post in 1943.', '[\"Rosie the Riveter\",\"Rosy the Riveter\",\"Rosie the Rivetter\",\"Rosie\",\"Rosy the Rivetter\",\"Rosie the Riviter\",\"Rosy the Riviter\"]', '70000', '30000', '30000', 'More popularly, a poster commissioned by Westinghouse in 1942 was aimed to encourage women to join the workforce. It was not associated with Rosie the Riveter until decades later, however. Originally the poster appeared for two weeks in a single midwest factory.', '10', '', '0', '1', '3', null), ('75', 'What word is blocked out of this picture?', '[\"Velveeta\",\"Velvita\",\"Velveta\"]', '70000', '30000', '30000', 'Velveeta was first made in 1918 by a Swiss immigrant in New York. The company was sold to Kraft in 1927.', '10', '', '0', '1', null, null), ('83', 'Finish the lyrics.', '[\"Jacket\"]', '70000', '30000', '30000', '\"Short Skirt, Long Jacket\" was featured in an Apple commercial in 2010 for the iPod Nano.', '10', '', '0', '1', '1', null), ('89', 'In Norman Rockwell\'s painting of Rosie the Riveter, there is a book under Rosie\\\'s boot. Who wrote the book?', '[\"Adolf Hitler\",\"Hitler\", \"Adolph Hitler\"]', '70000', '30000', '30000', 'The book under Rosie\'s foot is Adolf Hitler\'s manifesto, <i>Mein Kampf</i>. Published in 1925, its thesis revolves around an alleged Jewish conspiracy to gain world leadership.', '10', '', '0', '1', null, null), ('93', 'Name this actor, comedian, and writer who in 1982 pursued a career in music before moving on to an office.', '[\"Ricky Gervais\",\"Ricky Jervais\",\"Ricky Gervaise\",\"Ricky Jervaise\",\"Ricky Gervaze\",\"Ricky Jervaze\", \"Ricky Jervase\"]', '75000', '30000', '45000', 'Seona Dancing\'s singles failed to break the UK Top 40. However, in 1985 a DJ in Manila began playing \"More to Lose\" and the song became a major hit among Philippine teenagers. Seona Dancing were oblivious to their own success because the band had broken up a year earlier in 1984.', '10', '', '0', '0', null, null), ('97', 'Which Shakespeare play features a character named Caliban?', '', '60000', '30000', '30000', 'Caliban is an anagram of the Spanish word canibal, the source of the English word cannibal.', '10', '[{\"answer\":\"The Tempest\",\"correct\":true},{\"answer\":\"Macbeth\",\"correct\":false},{\"answer\":\"Hamlet\",\"correct\":false},{\"answer\":\"Othello\",\"correct\":false}]', '1', '0', null, null), ('104', 'This is a test question\'s with quote\'s and other quote\'s', '', '60000', '30000', '30000', '', '10', '[{\"answer\":\"quo\'ta\",\"correct\":true},{\"answer\":\"quo\'ter\",\"correct\":false}]', '1', '0', null, null), ('99', 'In 1989 the World Series was delayed for 10 days after the deadly Loma Prieta earthquake occured before Game 3. Name the city where this game was to be played.', '[\"San Francisco\",\"SanFrancisco\",\"San Fran\",\"SanFran\",\"San Fransisco\"]', '110000', '40000', '70000', 'Because of the coincidence of timing, it was the first major earthquake in the United States ever to be broadcast by live television.', '10', '', '0', '1', null, null), ('101', 'Name this father of 13 children and Russian realist author of <i>War and Peace</i> and <i>Anna Karenina</i>. ', '[\"Leo Tolstoy\",\"Tolstoy\",\"Leo Tollstoy\",\"Tollstoy\",\"Leo Tolestoy\",\"Tolestoy\",\"Lyev Tolstoy\",\"Lyev Nikolayevich Tolstoy\"]', '60000', '30000', '30000', 'Tolstoy believed being a Christian required him to be a pacifist. His ideas of nonviolent resistance were to have a profound impact on pivotal twentieth-century figures as Mahatma Gandhi and Martin Luther King, Jr.', '10', '', '0', '0', null, null);

